export const BEGIN = 'BEGIN';
export const SET_GAMER_NAME = 'SET_GAMER_NAME'
export const END = 'END';
export const ATTACK = 'ATTACK'
export const HEAL = 'HEAL'

export const begin = () => ({
type: BEGIN
});

export const setGamerName = (value: string) => ({
  type: SET_GAMER_NAME,
  value
})

export const end = () => ({
  type: END
  });

export const attack = (value:string, attacker:string, dommageInflige: number) => ({
  type: ATTACK,
  value,
  attacker,
  dommageInflige
})

export const heal = () => ({
  type: HEAL
})
